import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

import axios from 'axios';

const WorkExperience = () => {
  const { role } = useParams();
  const [workExperiences, setWorkExperiences] = useState([]);

  useEffect(() => {
    const fetchWorkExperiences = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/api/resume/workExperience/${role}`);
        setWorkExperiences(response.data);
      } catch (error) {
        console.error('Error fetching work experiences', error);
      }
    };

    fetchWorkExperiences();
  }, [role]);

  return (
    <div>
      <h2>Work Experience for {role}</h2>
      <ul>
        {workExperiences.map((workExperience, index) => (
          <li key={index}>
            <p>Name: {workExperience.firstName} {workExperience.lastName}</p>
            <p>Work Experience: {workExperience.workExperience}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default WorkExperience;
